export async function postData(url, data, dataType) {

    try {
      const body = JSON.stringify({[dataType]:data});
      console.log(body)
      const response = await fetch(url, {
        method: 'POST',
        body: body
      });
      return await response.json();
    } catch (error) {
      return {error:error}
    }
};
